import React from 'react'
import ProjectSummary from './ProjectSummary';


const PorjectList =()=> {
    return (
        <div className="project-list section"> 
           <ProjectSummary tarih="28 Haziran 1997" yazaradi="Muhammet METİN"></ProjectSummary>
           <ProjectSummary tarih="23 Haziran 2001" yazaradi="Ophan PAMUK"></ProjectSummary>
           <ProjectSummary tarih="12 Eylül 2019" yazaradi="Mustafa ATAŞ"></ProjectSummary>
           <ProjectSummary tarih="6 Ocak 2012" yazaradi="Mustafa ÖZKAN"></ProjectSummary>
           <ProjectSummary tarih="3 Haziran 1992" yazaradi="Ahmet TERKİN"></ProjectSummary>
        </div>
    )
}

export default PorjectList;
